import React, { useState } from "react";
import {
  Box,
  Center,
  Stack,
  Flex,
  ActionIcon,
  Autocomplete,
  rem,
  Avatar,
} from "@mantine/core";
import {
  IconHome2,
  IconUser,
  IconMessageCircle,
  IconBookmark,
  IconAlignLeft,
  IconSearch,
  IconCircleXFilled,
  IconBell,
} from "@tabler/icons-react";

const ResponsivePhone = () => {
  const [selectedBlackIcon, setSelectedBlackIcon] = useState(null);

  const handleBlackIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedBlackIcon(index);
  };

  const blackicons = [
    { name: "IconHome2", component: <IconHome2 /> },
    { name: "IconMessageCircle", component: <IconMessageCircle /> },
    { name: "IconBookmark", component: <IconBookmark /> },
    { name: "IconUser", component: <IconUser /> },
  ];

  return (
    <Stack>
      <Center>
        <Box
          style={{
            position: "relative", // Make the main box a relative container
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            border: "2px solid #1b1c1b",
            borderRadius: "15px",
            width: "320px", // Fixed width
            height: "411px", // Fixed height
            backgroundColor: "#ffffff",
            boxShadow: "0px 0px 10px rgba(0, 0, 0, 0.2)",
          }}
        >
          {/* Top Box */}
          <Box
            bg="dark.9"
            style={{
              width: "375px",
              height: "30px",
              border: "2px solid #000",
              borderRadius: "15px 15px 0px 0px",
            }}
          >
            <Center mt="xs">
              <Box
                bg="white"
                style={{
                  width: "50px",
                  height: "5px",
                  border: "2px solid #000",
                  borderRadius: "15px 15px 15px 15px",
                }}
              />
            </Center>
          </Box>

          {/* Center Box (Takes the remaining space) */}
          <Box
            bg="light.2"
            style={{
              flex: 1,
              width: "100%",
              border: "2px solid #000",
              marginTop: "-2px",
              marginBottom: "-2px",
              display: "flex",
              flexDirection: "column", // Arrange items in a column
            }}
          >
            <Flex
              mih={50}
              bg="gray.2"
              justify="space-around"
              align="center"
              direction="row"
              wrap="wrap"
              style={{
                border: "1px solid #1b1c1b",
                // borderRadius: "0 0 25px 25px",
                borderBottom: "1px solid #1b1c1b",
                padding: "10px",
              }}
            >
              {/* {blackicons.map((blackicon, index) => (
                <ActionIcon
                  bg="black"
                  radius="md"
                  key={index}
                  variant={selectedBlackIcon === index ? "transparent" : ""}
                  aria-label={`Icon ${blackicon.component}`}
                  onClick={() => handleBlackIconClick(index, blackicon)}
                >
                  {blackicon.component}
                </ActionIcon>
              ))} */}
              <IconAlignLeft style={{ marginLeft: "4px" }} />
              <Autocomplete
                    placeholder="Search"
                    leftSection={
                      <IconSearch
                        style={{ width: rem(16), height: rem(16) }}
                        stroke={1.5}
                      />
                    }
                    visibleFrom="xs"
                    radius="lg"
                  />
                  <Avatar bg="white" radius="xl">
                    <IconBell />
                  </Avatar>
            </Flex>
            {/* <Stack
              bg="gray.2"
              style={{
                borderBottom: "1px solid #1b1c1b",
              }}
            >
              <Flex mih={50} gap="md" justify="space-between" align="center">
                <Box style={{ flex: 1 }}>
                  <IconAlignLeft style={{ marginLeft: "4px" }} />
                </Box>
                <Box
                  style={{ display: "flex", alignItems: "center", gap: "md" }}
                >
                  <Autocomplete
                    placeholder="Search"
                    leftSection={
                      <IconSearch
                        style={{ width: rem(16), height: rem(16) }}
                        stroke={1.5}
                      />
                    }
                    visibleFrom="xs"
                    radius="lg"
                  />
                </Box>
                <Box
                  style={{
                    display: "flex",
                    alignItems: "center",
                    gap: "md",
                    marginRight: "4px",
                  }}
                >
                  <Avatar bg="white" radius="xl">
                    <IconBell />
                  </Avatar>
                </Box>
              </Flex>
            </Stack> */}

            <Box style={{ flex: 1, background: "white" }} />

            <Flex
              mih={50}
              bg="dark.9"
              justify="space-around"
              align="center"
              direction="row"
              wrap="wrap"
              style={{
                border: "1px solid #1b1c1b",
                // borderRadius: "0 0 25px 25px",
                padding: "10px",
              }}
            >
              {blackicons.map((blackicon, index) => (
                <ActionIcon
                  bg="black"
                  radius="md"
                  key={index}
                  variant={selectedBlackIcon === index ? "transparent" : ""}
                  aria-label={`Icon ${blackicon.component}`}
                  onClick={() => handleBlackIconClick(index, blackicon)}
                >
                  {blackicon.component}
                </ActionIcon>
              ))}
            </Flex>
          </Box>

          {/* Bottom Box (Positioned at the bottom) */}
          <Box
            bg="dark.9"
            style={{
              width: "375px",
              height: "30px",
              border: "2px solid #000",
              borderRadius: "0px 0px 15px 15px",
            }}
          >
            <Center mt="xs">
              <Box
                bg="white"
                style={{
                  width: "50px",
                  height: "5px",
                  border: "2px solid #000",
                  borderRadius: "15px 15px 15px 15px",
                }}
              />
            </Center>
          </Box>
        </Box>
      </Center>
    </Stack>
  );
};

export default ResponsivePhone;
